import React from "react";
import { Link } from "react-scroll";

const Navbar = () => {
  return (
    <div className="bg-gray-800 h-20 shadow flex items-center justify-between text-gray-300">
      <div className="flex justify-end">
        <ul>
          <Link>About</Link>
          <Link>Projects</Link>
          <Link>Contact</Link>
        </ul>
      </div>
    </div>
  );
};

export default Navbar;
